import "./blog.css";
import Header from "../Header/header";

export default function Blog(){
    return(
        <div className="Blog">
            <div className="Blog Top">
                <Header headerTitle="Blog" headerMoto="A Place To Freely Share Ideas"/>
            </div>
          
        </div>
    );
}
